import Navbar from '../navbar/Navbar';
import logo from './'
import "./Header.css"

const Header = () => {
    return (
    <div className="header">
        <h1 className="header-name">
            <img src="./component/mintyLogo.png" />
            Extra Minty
        </h1>
        <section className="navbar">
            <Navbar />
        </section>
    </div>
    )
}

export default Header;
